import React from 'react';
import { Header, Container } from 'semantic-ui-react'

export default class About extends React.Component{


    render(){

        return(
            <div>

              <Container textAlign='justified'>
                <Header class="aboutcontainer" color='blue' as='h1'>Mario Rodriguez</Header>
                <Header color='blue' as='h1'>Software Engineer | React.js, Ruby on Rails, Javascript</Header>
                <Header color='black' as='h3'>Full-stack web developer with a passion for problem-solving. With experience in Ruby on Rails, JavaScript, and React I discovered web development while taking computer science classes and I fell in love with it. I bring strong skills in working with people, communication in English and Spanish as well as managing people. I spend my free time playing guitar as well as building small projects and learning about new technologies.</Header>
              </Container>
            </div>
        )
    }
}
